        }
        /> }
        
        <PrivateRoute 
          path="/jokes"
          render={props => <JokeList {...props} 
            myJoke={myJoke}
            setUpdate={setUpdate}
            setIsUpdating={setIsUpdating} />
        }/>  */}

      </div>
      )
    }
    export default JokeContainer;
